import React from 'react'
import { Switch, Route } from "react-router-dom";

//import components css
import "./styles/App.css";
import "./styles/index.css";

//import component pages
import Home from "./components/pages/Home";
import About from "./components/pages/About";
import Contact from "./components/pages/Contact";

// import comoponents header
import NavButton from "./components/Header/NavButton";
import SiteName from "./components/Header/SiteName";
import Connection from "./components/Header/Connection";
import Logo from "./components/Header/Logo";
//images
import IMGLOGO from "./assets/img/Logo-Solidarite-Aulnay.png"

export default function MainPage() {
    return (
        <div>
             <NavButton />
        <SiteName text="SolidaritÃ© Aulnay" />
        <Logo images={IMGLOGO} />
        <Connection text="Se connecter / S'inscrire" />
      <Switch>
          <Route exact path="/" component={Home} />
          <Route path="/about" component={About} />
          <Route path="/contact" component={Contact} />
        </Switch>
        </div>
    )
}
